import * as React from 'react';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import DeleteIcon from '@mui/icons-material/Delete';
import { styled } from '@mui/material/styles';
import DownloadIcon from '@mui/icons-material/Download';
import "./MoAttachment.css";
import MultipleSelectPlaceholder from './components/MoDropdown/MoDropdown';

export const DeleteButton = styled(Button)(() => ({
    // color: "rgb(134, 112, 52)",
    // backgroundColor: "#1b7028",
    cursor: "pointer",
    textTransform: "none",
    // borderColor:"rgb(134, 112, 52)"

}));
export const MyCardHeading = styled(Typography)((props) => ({
    color: props.color,
    fontSize: "20px",
    fontWeight: 'bold',
    marginBottom: '2px'

}));
export const MyCardSubHeading = styled(Typography)((props) => {
    console.log(props.color); return ({
        color: props.color,
        fontSize: "15px",
        fontWeight: 'bold',
        marginBottom: '2px'
    })
});
export default function SimpleAccordion() {

    const data = [{ name: "hello.jpeg", desc: "reference docs for the React Accordion component. Learn about the props, CSS, and other APIs of this exported module API. API reference docs for the React  component. Learn about the props, CSS, and other APIs of this exported" },
    { name: "hellonot.pdf", desc: "not hello Accordion. API. API reference docs for the React Accordion component. Learn about the props, CSS, and other APIs of this exported module API. API reference docs for the React  component. Learn about the props, CSS, and other APIs of this exported module.." }];

    const milestoneName="Milestone 1 Attachment"

    return (
        <div>
            <Accordion>
            <AccordionSummary
                    expandIcon={<ExpandMoreIcon />}
                    aria-controls="panel1a-content"
                    id="panel1a-header"
                >
                    <Typography>{milestoneName}</Typography>

                </AccordionSummary>
                <hr />
                { data.map((d)=>(
                <AccordionDetails className='attachment-detail'>
                    <div className='attachment-detail-content'>
                        <MyCardSubHeading>{d.name}</MyCardSubHeading>
                        <p>{d.desc}</p>
                    </div>
                    <div className='attachment-detail-action'>
                        <DeleteButton variant="outlined" color="primary" startIcon={<DeleteIcon />}>
                            Delete
                        </DeleteButton>
                        < DownloadIcon className='download-icon' />
                    </div>


                </AccordionDetails>
                ))}
                <Button className='add-attachment-button' variant="contained" >
                            Add Attachments
                        </Button>
            </Accordion>


        </div>
    );
}
